(5010, '3271276033261168227', 'gojekindonesia', 13, 'https://www.instagram.com/p/C1l6Dhkx-Zj/', 'Warga Jogja siapa yang pernah dianter sama Pak Rian?\n\nKata terima kasih dari kamu jadi bahan bakar buat Pak Rian untuk selalu memberikan servis terbaik, lho. Selain itu, beliau juga selalu bahagia ketika melihat orang lain bahagia, termasuk Kastamernya.üíö\n', 1438, '2024-01-02 09:09:37', 0.00135092, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3271276033261168227', 289, 1, 13158),
(5011, '3263872329797046450', 'gojekindonesia', 13, 'https://www.instagram.com/p/C1LmpdZx5Cy/', '[GIVEAWAY]\n\nUdah mau tahun baru aja nih, Mimin pengen bagi-bagi hadiah ah~ü•≥üéâ\n\nAda hadiah dengan total Rp7.000.000 buat 5 orang pemenang! Ikutin ini ya ges:\n\n1. Pastikan akun kamu tidak di-private dan follow @gojekindonesia\n2. Tebak dan tulis jawaban yang tepat di kolom komentar\n3. Mention 2 orang temen\n4. 1 orang beruntung dapet smartphone senilai 5 juta dan 4 orang beruntung lainnya dapet GoPay masing-masing 500 ribu\n5. Periode kuis 23 Desember 2023 - 5 Januari 2024\n6. Pemenang akan diumumin tanggal 11 Januari 2024 di IG Story, Twitter, dan FB @gojekindonesia\n7. Pihak Gojek Indonesia berhak untuk melakukan penambahan atau pengurangan syarat dan ketentuan yang berlaku tanpa melakukan pemberitahuan lebih dahulu\n8. Keputusan juri tidak dapat diganggu gugat\n\nBaca programnya, pilih jawabannya, dan menangin hadiahnya!\n', 5458, '2023-12-23 03:58:43', 0.0244754, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3263872329797046450', 25831, 0, NULL),
