(5015, '3261182786161557328', 'gojekindonesia', 13, 'https://www.instagram.com/p/C1CDHcsxz9Q/', 'Bagi Pak Irfan, tantangan di jalan selalu ada tapi wajib dihadapi!\n\nKenalin Driver Jempolan yang selalu memberikan servis terbaik untuk kamu semua dari Medan, Pak Irfan! Sebagai mitra driver yang mempunyai order terbanyak se-Medan, semoga Pak Irfan sehat selalu dan tetap memberikan pelayanan terbaiknyaüëçüèª‚ú®\n', 1386, '2023-12-19 10:55:49', 0.00124063, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3261182786161557328', 200, 1, 9997),
(5016, '3260520701492520394', 'gojekindonesia', 13, 'https://www.instagram.com/p/C0_sk2TROXK/', 'Setelah 3 tahun, para penerima Beasiswa Gojek angkatan pertama kini sudah lulus kuliahüéì\n\nPelatihan soft skill pun diberikan sebagai bekal para wisudawan menjalani tantangan baru di dunia kerja nantinya. Bapak Menteri Perhubungan RI @budikaryas turut berbagi pengalaman serta kisah sukses agar para anak mitra driver penerima Beasiswa Gojek terinspirasi untuk terus mengejar mimpi, pantang menyerah!\n\nTahun ini, Gojek kembali memberikan beasiswa kuliah bagi para anak mitra driver yang berprestasi. Keberlangsungan program ini gak lepas dari dukungan para pelanggan setia Gojek, jadi makasih ya bagi kalian semua yang baca ini!üíö\n', 1430, '2023-12-18 13:02:34', 0.00121951, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3260520701492520394', NULL, 0, NULL),
(5017, '3256829025519613270', 'gojekindonesia', 13, 'https://www.instagram.com/p/C0ylL5IRzVW/', 'Jadi gini wir~\nKalo susah misahin trip pribadi sama trip bisnis bisa pake Profil Bisnis ajaü§≠\n\nSemua trip kepisah, reimburse jadi gampang~~\nSiapa yang udah aktifin Profil Bisnis Gojek?\n', 1025, '2023-12-13 10:45:25', 0.00106932, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3256829025519613270', 342, 1, 12518),
(5018, '3255365407259170538', 'gojekindonesia', 13, 'https://www.instagram.com/p/C0tYZcZxxbq/', 'Kenalin Dzikru Rahman, salah satu anak mitra driver yang menjadi wisudawan Beasiswa Gojek.\nPada tahun 2020 lalu, setelah melalui berbagai tahap seleksi, Dzikru resmi tercatat sebagai mahasiswa jurusan Teknik Mesin, Politeknik Negeri Jakarta.\n\nSetelah 3 tahun, Dzikru berhasil menyelesaikan kuliahnya dengan predikat Cum Laudeüíö\nDzikru juga berhasil diterima di salah satu perusahaan terkemuka di Indonesia.\n\nTahun ini, Beasiswa Gojek kembali memberikan biaya kuliah gratis buat putra-putri mitra driver Gojek se-Indonesia yang telah berhasil melewati seleksi ketat. Program Beasiswa Gojek dapat terlaksana salah satunya juga tidak lepas dari dukungan para pelanggan setia Gojek selama ini.\n', 2932, '2023-12-11 10:17:32', 0.00259702, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3255365407259170538', 388, 1, 49330),
