(5021, '3247442548700421876', 'gojekindonesia', 13, 'https://www.instagram.com/p/C0RO8rXxx70/', 'Setiap manusia mengarungi perjalanannya masing-masing. Tidak jarang, perjalanan itu menjadi makin bermakna bersama mitra driver Gojek. Kita diingatkan kembali tentang arti keikhlasan dan hal-hal kecil yang tidak bisa ditakar dengan materi, seperti cerita Pak Maryono dan Pak Soleh. Pak Maryono membuat program Jumat Berkah dan membuat salah satu customer-nya tersentuh. Lalu, Pak Soleh pernah membantu seorang customer yang sedang sakit dengan upaya yang sederhana, tetapi bernilai adanya. Sebagai Driver Jempolan, keduanya menceritakan perjalanan mereka di video ini. Simak selengkapnya!\n\nKalau kamu punya Cerita Gojek yang bermakna, kirimkan ke bit.ly/shareCeritaGojek.\n\n#CeritaGojek #DriverJempolan\n', 3789, '2023-11-30 12:00:08', 0.00321734, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3247442548700421876', 324, 1, 27905),
