(5025, '3240939182620167513', 'gojekindonesia', 13, 'https://www.instagram.com/p/Cz6IQPuuE1Z/', '[GIVEAWAY]\nGojek bagi-bagi hadiah lagiü•≥\n\nYuk, jawab tebak-tebakan di atas soalnya kamu bisa menangin total hadiah senilai Rp7.000.000!\nGini cara ikutannya:\n\n1. Pastikan akun kamu tidak di-private dan follow @gojekindonesia\n2. Tebak dan tulis jawaban yang tepat di kolom komentar\n3. Kamu boleh jawab lebih dari satu kali\n4. 1 orang beruntung dapet hape senilai 5 juta dan 4 orang beruntung lainnya dapet GoPay masing-masing 500 ribu\n5. Periode kuis 21 November - 5 Desember 2023\n6. Pemenang akan diumumin tanggal 12 Desember 2023 di IG Story, Twitter, dan FB @gojekindonesia\n7. Pihak Gojek Indonesia berhak untuk melakukan penambahan atau pengurangan syarat dan ketentuan yang berlaku tanpa melakukan pemberitahuan lebih dahulu\n8. Keputusan juri tidak dapat diganggu gugat\n\nCek clue-nya, tebak gambarnya, tulis jawabannya, dan menangin hadiahnyaüéÅ\n', 7027, '2023-11-21 12:34:45', 0.0439249, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3240939182620167513', 49126, 0, NULL),
(5026, '3240171271589494214', 'gojekindonesia', 13, 'https://www.instagram.com/p/Cz3Zpq2hH3G/', 'Ready anterin ke mana aja dan siapa aja!\nKenalin.. Pak Edi Haryanto, Driver Jempolan dari Palembangü•≥\n\nMulai dari karyawan hingga murid sekolah pernah Pak Edi antar ke tujuannya. Beliau punya prinsip walaupun cepat harus tetap aman!\n\nSiapa yang pernah dianter Pak Edi di Palembang?\n', 1818, '2023-11-20 11:09:26', 0.00163957, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3240171271589494214', NULL, 0, NULL),
(5027, '3237261320738142579', 'gojekindonesia', 13, 'https://www.instagram.com/p/CztEAT7tXlz/', 'Sevvuah pencerahan dari SUHUüôèüèª\nKalo mau otw kantor bisa langsung gas pake\n\n‚ú®GoRide Transit‚ú®\n\nLebih praktis, gak worry kalo ketinggalan kartu~\nPake juga kode promo GOSTASIUN buat dapet diskon sampe 90%!\n\nTag temen kamu yang harus pake GoRide Transitü§≠\n', 1556, '2023-11-16 10:47:48', 0.00141976, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3237261320738142579', 259, 1, 19126),
(5028, '3232250504021455267', 'gojekindonesia', 13, 'https://www.instagram.com/p/CzbQrVNRrGj/', 'Memberikan kemudahan dan membawa manfaat sudah menjadi kebiasaan sehari-hari para mitra ekosistem GoTo. Namun, diantara yang terbaik pun masih ada mereka yang dengan senantiasa memberikan lebih.\n\nMitra Juara GoTo 2023 memperkenalkan mitra-mitra juara seluruh ekosistem GoTo yang tidak kenal lelah maupun pantang menyerah, demi memberikan yang terbaik bagi pelanggan serta masyarakat sekitar.\n\nGotong royong dalam membawa perubahan dan mendorong kemajuan adalah yang utama dalam upaya menjadi kebangaan Indonesia.\n\n#MitraJuaraGoTo2023\n', 2307, '2023-11-09 12:53:54', 0.00221842, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3232250504021455267', NULL, 0, NULL),
(5029, '3231264334256878295', 'gojekindonesia', 13, 'https://www.instagram.com/p/CzXwcrCxTLX/', 'Selain naik gaji, naik jabatan juga enak sih tapi...\n\nNaik GoCar Hemat juga gak kalah enak~ Mulai dari Rp10 ribu aja, kamu bisa jalan-jalan sampe cafe hopping, gaes. Mobilnya ekonomis tapi tetep nyaman dan gak kepanasanü§≠\n\nYuk, cobain GoCar Hemat biar isi dompet gak kelabakan, hati jadi lebih aman ‚ú®\n', 1598, '2023-11-08 04:12:30', 0.00143697, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3231264334256878295', 239, 0, NULL),
(5030, '3224233362038588117', 'gojekindonesia', 13, 'https://www.instagram.com/p/Cy-xyj5RgLV/', '‚ú®Jaket, lambang gotong royong Anak Bangsa‚ú®\n\nLahir dan tumbuh di Indonesia, Gojek, @tokopedia, @gopayindonesia dan @jadijago selalu berusaha buat terus berinovasi untuk memudahkan setiap aktivitas Kastamer setia. \n\nTahun ini jadi saksi baru dari kolaborasi empat Karya Anak Bangsa, satu jaket terbaru telah hadir hasil dari gotong royong, kebersamaan dan semangat untuk memajukan Indonesiaüíö\n\nSiap-siap buat ketemu para Mitra Driver dengan jaket terbarunya!\n', 2886, '2023-10-29 11:25:02', 0.00321342, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3224233362038588117', 1222, 1, 42913),
