(5040, '3209669323971568130', 'gojekindonesia', 13, 'https://www.instagram.com/p/CyLCT6dyyIC/', 'Pernah gasih kalian nongkrong ke suatu tempat, eh tapi mau pindah lagi ketempat lain? \n\nTenang, sekarang cari tempat nongkrong bisa hemat banget pake GoRide yang ngasih diskon sampe 30rb pake kode promo GORIDEAJA. Kalo mau GoCar juga bisa, pake kode promo GOCARAJA, dapet diskon sampe 30rb!\n', 1083, '2023-10-09 09:08:25', 0.000953545, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3209669323971568130', 136, 1, 10118),
