(5066, '3175697822676681523', 'gojekindonesia', 13, 'https://www.instagram.com/p/CwSWFgaoAMz/', 'Kamu si pekerja yang selalu rempong karna bawa tas besar? \n\nGak usah bingung lagi karna GoRide Comfort selalu setia mengantar, pasti lebih nyaman, jok motor lebih lebar. Karena semuaa.. #PastiAdaJalan~\n', 1213, '2023-08-23 12:12:09', 0.00098327, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3175697822676681523', 44, 1, 57317),
