(5068, '3171791129635014307', 'gojekindonesia', 13, 'https://www.instagram.com/p/CwEdzo_oUaj/', 'Inilah semangat orang Indonesia yang diwakilkan oleh jutaan Mitra Driver Gojek dan Mitra Usaha GoFood se-Indonesia. Semangat yang yakin bahwa pas tiada jalan, #PastiAdaJalan.\n\nDirgahayu Republik Indonesia, Terus Melaju untuk Indonesia Maju.\n', 1233, '2023-08-18 02:52:05', 0.00105915, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3171791129635014307', NULL, 0, NULL),
