(5070, '3166934583244256913', 'gojekindonesia', 13, 'https://www.instagram.com/p/CvzNjltLHaR/', 'MAU HEMAT GINI AMATüòÆ‚Äçüí®üòÆ‚Äçüí®üòÆ‚Äçüí®\n\nJangan sampe lagi asik lomba 17-an malah jadi jurus jitu buat berhemat. Karena pasti ada jalan dari GoFood buat penuhin keinginan kamu! Mulai dari menu trending sampe makanan Indonesia, semuanya adaü•≥üáÆüá©\n\nDitambah #PastiAdaPromo hingga 120ribu + Bestoran 8.8 Beli 1 Dapat 1 hanya di GoFood‚ú®\n\nYuk, GoFood-in sekarang!üôåüèªüëçüèª\n', 2162, '2023-08-11 10:05:00', 0.00198219, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3166934583244256913', NULL, 0, NULL);
