(5071, '3166795209384637699', 'gojekindonesia', 13, 'https://www.instagram.com/p/Cvyt3brx7UD/', 'üèÄ[#GIVEAWAY]üèÄ\nEmang boleh se-anak basket iniü§≠\n\nGojek dan FIBA mau bagi-bagi buanyak hadiah buat kamu yang ngaku anak basket banget!\n\nGini caranya:\n1. Pastiin akun kamu gak diprivate\n2. Post foto nge-Gojek kamu, tag @gojekindonesia & @perbasi.ina, pake hashtag #GojekFIBA2023 & #JalanJajanJuara dan mention 3 temen\n3. Jelaskan 1 hal yang kamu suka dari Gojek di caption\n4. 10 orang yang beruntung dapet masing-masing 1 tiket FIBA dan 5 orang beruntung dapet masing-masing 1 official Molten Basketball\n5. Periode kuis 11-20 Agustus 2023\n6. Pemenang akan diumumkan tanggal 23 Agustus 2023 di IG Story\n7. Pihak Gojek Indonesia berhak untuk melakukan penambahan atau pengurangan syarat dan ketentuan yang berlaku tanpa melakukan pemberitahuan terlebih dahulu‚Å£‚Å£\n8. Keputusan juri tidak dapat diganggu gugat‚Å£‚Å£‚Å£\n\nMimin tunggu momen nge-Gojek kamu, ya!\n', 1351, '2023-08-11 05:23:48', 0.00123906, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3166795209384637699', NULL, 0, NULL),
(5072, '3165548903458545014', 'gojekindonesia', 13, 'https://www.instagram.com/p/CvuSfS1xh12/', '[GIVEAWAY] \n\nYuk Main BERGO BAKBAR (BERsama GOjek teBAK gamBAR)\n\nBukan Gojek namanya, kalo gak ngadain Giveaway yang bar-bar. Soalnya, cuma dengan menjawab tebak gambar kamu bisa dapetin hadiah total 8 juta! \n\nMau ikutan? Gini nih caranya:\n1. Pastikan akun kamu tidak diprivate dan follow @gojekindonesia\n2. Tebak gambar dengan jawaban yang tepat dan sertakan hashtag #PastiAdaJalan\n3. Kamu boleh kok jawab sebanyak-banyaknya\n4. Menangin HP senilai Rp5.000.000 untuk satu orang dan saldo GoPay masing-masing Rp500.000 untuk 6 orang\n5. Periode kuis 9 Agustus - 6 September 2023\n6. Pemenang akan diumumin tanggal 9 September 2023 di IG Story, Twitter, dan FB @gojekindonesia\n7. Pihak Gojek Indonesia berhak untuk melakukan penambahan atau pengurangan syarat dan ketentuan yang berlaku tanpa melakukan pemberitahuan lebih dahulu\n8. Keputusan juri tidak dapat diganggu gugat\n\nAda sapu ijuk punya Tatan,\nYuk ikutan!\n', 4186, '2023-08-09 12:07:42', 0.0384438, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3165548903458545014', 44960, 0, NULL),
