(5074, '3156824030371721824', 'gojekindonesia', 13, 'https://www.instagram.com/p/CvPSrrkuTJg/', 'Punya pengalaman menarik saat naik GoRide atau GoCar bersama Driver Gojek? Yuk, ceritakan pengalamanmu di bit.ly/CeritaGojek dan raih kesempatan mendapat hadiah Rp 1 juta! \n\nCeritamu juga bisa muncul di @gojekindonesia, jika ceritamu menarik dan driver sesuai kriteria, driver akan diapresiasi menjadi Driver Jempolan‚ú®\n', 2241, '2023-07-28 11:14:56', 0.00195637, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3156824030371721824', NULL, 0, NULL),
