(5077, '3153069055465372750', 'gojekindonesia', 13, 'https://www.instagram.com/p/CvB85mrSjxO/', 'Bingung gimana caranya mau anterin keluarga satu-satu? Ibu berangkat kerja, papa harus ke stasiun, adek mau ke sekolah, kakak mau les, ditambah kakek mau ke kondangan. \n\nTenang, kan ada Gojek! Siap anterin seluruh keluarga tanpa ribet, super satset, gak bikin kantong seret. Pake kode promo GORIDEAJA, diskonnya sampe 30 ribu!\n', 1246, '2023-07-23 06:52:23', 0.0010834, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3153069055465372750', 139, 0, NULL),
