(5079, '3148745337799171409', 'gojekindonesia', 13, 'https://www.instagram.com/p/CuylzOzr91R/', 'Mengantar, Menjemput, Mengutamakan Waktu‚Ä¶üéµ\nJalani Tujuan Muliaüé∂\n\nSetuju banget sama Driver Jempolan satu ini, Ibu Linda mengatakan, ‚ÄúJangan ragu untuk membantu orang, karena bisa jadi suatu hari kita yang membutuhkan bantuan orang lain.‚Äù melalui aksi Ibu Linda yang menggendong seorang nenek tua, beliau terus membantu siapapun demi keselamatan semua kastamernya.\n\nKamu ada pepatah dari #CeritaGojek lainnya? Tulis di kolom komentar ya!‚ú®\n', 2334, '2023-07-17 07:42:35', 0.00190474, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3148745337799171409', NULL, 0, NULL),
(5080, '3146615937918116898', 'gojekindonesia', 13, 'https://www.instagram.com/p/CurBoYoMSQi/', 'Kalau di dunia nyata pasti ada aja ributnya, alhasil jadi telat. Tapi kalo pakai GoRide ga akan telat sih!  Ada kode promo GORIDEAJA lagi, pasti lebih irit ‚ú®\n', 1212, '2023-07-14 09:11:39', 0.000991875, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3146615937918116898', NULL, 0, NULL),
(5081, '3146449540853690802', 'gojekindonesia', 13, 'https://www.instagram.com/p/Cuqby_SRnGy/', 'üö®[#GIVEAWAY]üö®\n\nANAK BASKET KUMPUL SINI!\nMimin punya banyak hadiah buat kamu si ABAS, alias Anak BASket‚õπüèª\n\nGini caranya:\n1. Pastiin akun kamu gak diprivate\n2. Jawab pertanyaan di atas dengan format: [JAWABAN KAMU], hashtag #GojekxIBL, domisili-mu dan mention 3 temen\n3. Tulis jawaban di kolom komentar \n4. Boleh jawab sebanyak-banyaknya\n5. 1 orang beruntung akan dapet 2 tiket VIP final + 2 jersey, 2 orang beruntung akan dapet 2 tiket tribune final + 1 jersey, dan 6 orang beruntung lainnya akan dapet official merchandise \n6. Periode kuis 14-18 Juli 2023\n7. Pemenang akan diumumkan tanggal 19 Juli 2023 di IG Story\n8. Pemenang terpilih HANYA akan dihubungi melalui DM Gojek Indonesia\n9. Pihak Gojek Indonesia berhak untuk melakukan penambahan atau pengurangan syarat dan ketentuan yang berlaku tanpa melakukan pemberitahuan terlebih dahulu‚Å£‚Å£\n10. Keputusan juri tidak dapat diganggu gugat‚Å£‚Å£‚Å£\n\nMimin tunggu jawaban kamu, ya!ü§©\n', 1369, '2023-07-14 03:40:36', 0.00152301, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3146449540853690802', 578, 0, NULL),
(5082, '3145186297060422213', 'gojekindonesia', 13, 'https://www.instagram.com/p/Cul8kX0tnJF/', 'Punya pengalaman berkesan bareng GoRide atau GoCar? Yuk, bagikan #CeritaGojek-mu melalui bit.ly/CeritaGojek!\n\nKamu berkesempatan memenangkan saldo GoPay sebesar Rp1.000.000, dan cerita yang terpilih akan tampil di @gojekindonesia. Gak hanya itu, driver kalian juga akan mendapat apresiasi menjadi Driver Jempolan.\n', 1337, '2023-07-12 09:50:49', 0.00159029, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3145186297060422213', 696, 0, NULL),
(5083, '3140068263035679847', 'gojekindonesia', 13, 'https://www.instagram.com/p/CuTw3LMuDRn/', 'HAH?! GRATIS?!\n\n‚ú®G R A T I S‚ú®\n\nSikat menu favorit sekitar kamu dengan promo Rabu Gratis dari Mode Hemat! Tinggal pilih makanan yang kamu mau, terus pake Mode Hemat biar langsung nikmatin GRATIS ongkirnyaü§§ü´∂üèª\n\nKira-kira mau jajan apa hari ini, GoFoodies?ü§î\n', 1507, '2023-07-05 08:23:37', 0.00126018, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3140068263035679847', 104, 1, 17678),
(5084, '3139369141990938215', 'gojekindonesia', 13, 'https://www.instagram.com/p/CuRR5n_MVZn/', 'Bersama Gojek, yuk ciptakan ruang aman dari kekerasan seksual!\n\nKeamanan serta kenyamanan Kastamer dan Mitra jadi prioritas utama bagi Gojek. Berbagai inovasi teknologi serta pembekalan menyeluruh pun terus dibuat untuk menjamin keamanan serta kenyamanan dalam ekosistem Gojek.\n\nSalah satunya bekerja sama dengan organisasi Di Jalan Aman Tanpa Pelecehan (DEMAND) dengan menghadirkan SIUL dan BANTU. Sebuah panduan buat Mitra dan Kastamer biar sama-sama menjaga serta menciptakan ruang aman dari kekerasan seksual.\n\nMari ciptakan ruang #AmanBersamaGojek yang bikin tenang serta cegah dan lawan semua jenis kekerasanüíö\n', 1013, '2023-07-04 09:13:47', 0.00085733, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3139369141990938215', 83, 1, 10179),
