(5086, '3131327081472082560', 'gojekindonesia', 13, 'https://www.instagram.com/p/Ct0tWPetEKA/', 'Buat kalian yang masih suka bingung pesen tiket KRL commuterline, pesen aja lewat GoTransit. Pastinya lebih praktis, mudah dan #JalanTerus ke mana pun kamu mau! ‚ú®\n', 1526, '2023-06-23 06:55:12', 0.0012727, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3131327081472082560', NULL, 0, NULL),
(5087, '3130768137872613103', 'gojekindonesia', 13, 'https://www.instagram.com/p/CtyuQisAh7v/', 'Serba ada, selalu sediaü´∂üèª\n\nKenalin, Pak Deddy Mulyadi Driver Jempolan dari Bekasi. Rasa peka dan kepeduliannya sangat tinggi. Sehingga memberi kehangatan kepada siapa saja kastamernya.\n\nTonton #CeritaGojek Pak Deddy sampai habis!\n', 1023, '2023-06-22 12:25:06', 0.000884709, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3130768137872613103', NULL, 0, NULL),
(5088, '3129239640696499977', 'gojekindonesia', 13, 'https://www.instagram.com/p/CttSt-wyS8J/', 'HalTeman pernah mendengar tentang GoTransit? Jangan-jangan sudah banyak yang pakai layanan dari @gojekindonesia yang satu ini. Tetapi, mau sudah tahu atau belum, sering pakai atau enggak, HalteMin mau ajak HalTeman untuk mengenal dan mencoba langsung layanan ini.\n\nTentunya enggak mungkin mengajak semua HalTeman ikutan langsung mencoba layanan ini. Jadi, HalteMin dan Gojek akan memilih tujuh orang HalTeman yang beruntung untuk diajak #JalanTerus bareng GoTransit dan mendapatkan saldo GoPay senilai satu juta rupiah!\n\nAcara jalan terus bareng GoTransit ini akan diadakan hari Sabtu tanggal 8 Juli 2023. Jadi, HalTeman yang mau ikut pastikan hari itu tidak ada kegiatan lain.\n\nCaranya? Jawab pertanyaan berikut di kolom komentar: \n\n‚ÄúApa fungsi GoTransit saat kamu lagi di stasiun?‚Äù\n\nPrasyarat dan ketentuannya:\n1.	Follow Instagram @gojekindonesia dan @darihalte_kehalte\n2.	Jawab pertanyaan di kolom komentar dan sertakan hashtag #JalanTerus\n3.	Jangan kunci Instagram HalTeman\n4.	Like dan share posting-an ini di Instagram HalTeman dan jangan lupa mention @gojekindonesia dan @darihalte_kehalte sertakan hashtag #JalanTerus\n\nKomentar HalTeman HalteMin tunggu sampai hari Senin, 3 Juli 2023, jam 12 malam teng, ya!\n\n#dhkh\n', -1, '2023-06-20 09:47:36', 0.00222468, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3129239640696499977', NULL, 0, NULL),
