(5094, '3114844939574580174', 'gojekindonesia', 13, 'https://www.instagram.com/p/Cs6JvgpxBPO/', '‚ÄúIt‚Äôs not about us, but it starts with us‚Äù -\nDi GoTo, ini adalah salah satu nilai yang kami percaya.\n\nBertepatan dengan ulang tahun ke dua, GoTo menggelar program ‚ÄúPartner for a Day‚Äù untuk para karyawan. Tujuan program ini adalah memberikan kesempatan kepada mereka supaya memiliki pemahaman mendalam tentang cara kerja para mitra pengemudi, merchant maupun seller di ekosistem GoTo.\n\nRatusan karyawan telah mendaftar untuk ikut program ini. Di antara mereka bahkan mencoba menjadi mitra yang bukan berasal dari unit bisnisnya. \n\n#GoToTurnsTwo #PartnerForADay\n', 1433, '2023-05-31 13:09:10', 0.0013079, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3114844939574580174', NULL, 0, NULL),
