(5184, '3363252023624318541', 'grabid', 14, 'https://www.instagram.com/p/C6sq-VuPb5N/', 'Pengen langsung jago, pengen langsung keren, bikin Gen Z jadi sulit menghargai dan menikmati proses. Bener nggak? \n\nTapi di era yang dikit-dikit pamer kesuksesan seperti sekarang ini rasanya hal itu dirasakan semua orang. Bagi @emmanuelle.elizabeth dorongan untuk menjadi sukses dengan cepat justru menimbulkan kesadaran baru, bikin Gen Z jadi lebih apresiatif dengan pencapaian-pencapaian kecil, alias small wins matter. Mahasiswa Desain Komunikasi Visual ITB ini bilang, merayakan pencapaian kecil membuat generasinya lebih menikmati keseimbangan hidup, dan menyadari bahwa kita lagi berposes lho. \n\nMeskipun digempur dengan teknologi AI yang mungkin bisa menggantikan profesi visual illustrator, Emma tetap yakin bahwa goresan tangan yang dibuat secara personal akan lebih autentik. Hingga saat ini Emma telah menghasilkan banyak karya ilustrasi dalam berbagai tema dan medium. Salah satu yang paling berkesan adalah saat dipercaya Disney PIXAR membuat ilustrasi untuk materi promosi film Turning Red. \n\nDitunggu karya hebat lainnya ya, Emma!\n\n#GenerasiPercaya\n', 2982, '2024-05-08 06:50:59', 0.00272259, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3363252023624318541', NULL, 0, NULL),
