(5231, '3322037374500008002', 'grabid', 14, 'https://www.instagram.com/p/C4aP2QlpPBC/', 'üì£ Tonton sampai akhir video resepnya, ada kode voucher GrabMart diskon 50%!\n\nSahabatku Tercinta, yuk awali bulan puasa dengan yang segar dan manis ‚ù§Ô∏è\nIni dia resep minuman simple bersama Fanta, Es Fantasi (Fanta, Kolang kaling dan Selasih).\n\nCocok untuk berbuka, atau ide jualan sahabatku di seluruh Indonesia.\n\n#GrabMart #sejamsampai #Aplikasih\n', 15857, '2024-03-12 10:04:17', 0.0143027, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3322037374500008002', 234, 1, 898729),
(5232, '3321793345549579727', 'grabid', 14, 'https://www.instagram.com/p/C4ZYXK6vTXP/', 'Ay ya ya!\nEits, ada kabar gembira nih dari Nassar, bukan Nastar ya!\n\nBagimu Seller dari GrabExpress siap bantu seller se-Indonesia buat kirim-kirim jualan lebih cuan!\n\nPeNassaran? Bagimu Seller dari GrabExpress punya ongkir mulai dari Rp5rb, terus punya diskon ongkir unlimited dengan langganan Paket Ongkir Unlimited cuma Rp1rb, ada juga cashback gede sampai 1jt dengan join Klub Juragan GrabExpress!\n\nSelain itu, ada pelatihan buat seller biar jualannya makin cuan!\n\nGimana? Yuk semuanya! Kirim paket pake GrabExpress!\n\n#Nassar #KingNassar \n#NassarOppa #BagimuSeller\n', 10573, '2024-03-12 02:00:11', 0.00954018, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3321793345549579727', 160, 1, 702071),
(5233, '3321784542334622312', 'grabid', 14, 'https://www.instagram.com/p/C4ZWXESPRpo/', 'Bulan Ramadan yang ditunggu-tunggu akhirnya datang juga. Banyak banget berkah yang bisa kita dapetin di bulan ini. Makanya Grab hadir sebagai #Aplikasih untuk sesama buat bantuin kamu kasih ke orang-orang terkasih. \n\nKamu bisa dengan mudah kasih makanan ke tetangga, kasih belanjaan untuk sahur, kasih untuk silaturahmi rame-rame, sampai kasih bingkisan juga bisa! Pahalanya dapet, promonya juga dapet dong pastinya! üíö\n', 11540, '2024-03-12 01:41:04', 0.0103464, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3321784542334622312', 100, 1, 1643478),
(5234, '3319680909824635519', 'grabid', 14, 'https://www.instagram.com/p/C4R4DL1vjJ_/', 'Mbak @najwashihab bilang, ‚ÄúInvestasi pada diri sendiri itu harus diupayakan, dengan usaha keras secara konsisten, dan butuh pengorbanan, sehingga sekecil apa pun pencapaiannya harus dirayakan‚Äù. \n\nDalam bincang-bincang memperingati Hari Perempuan Internasional bersama ratusan karyawan Grab Indonesia dan OVO, mbak @neneng.goenadi (Country Managing Director, Grab Indonesia) juga menyampaikan, ‚ÄúBangun lebih pagi buat olahraga itu effort banget, tapi saya melakukan itu sebagai investasi buat diri sendiri, supaya badan tetap bugar dan kerja jadi lebih fokus‚Äù. \n\nKamu sudah melakukan investasi apa nih untuk diri sendiri? Yuk, kita mulai dari hal sederhana. \n\nTerima kasih mbak @najwashihab telah berbagi cerita dan mengingatkan teman-teman sesama perempuan Indonesia akan pentingnya berinvestasi pada diri sendiri untuk kemajuan bersama. \n\nSelamat Hari Perempuan Internasional!\n\n#PercayaPerempuan\n', 792, '2024-03-09 04:00:24', 0.000719091, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3319680909824635519', 17, 0, NULL),
(5235, '3319632773047562664', 'grabid', 14, 'https://www.instagram.com/p/C4RtGs-PrGo/', 'Dengan Sobat Hemat, ada yang bisa dibantu? üòä\n\nOh, mau order ini itu tapi tetep murah? Yaudah kak, coba simak dulu videonya sampai akhir, udah di spill cara HEMAT versi mimin Grab, kalo versi kamu gimana? üëÄ\n', 9110, '2024-03-09 02:25:58', 0.008118, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3319632773047562664', 23, 1, 570914),
(5236, '3319140656558768048', 'grabid', 14, 'https://www.instagram.com/p/C4P9Ndxvf-w/', 'Orange Chicken Fantaüçóüçäü•§\n‚Äî bikin ayam pake soda?!\n\nGak berasa ya ternyata sebentar lagi udah Ramadhan lagi..ü•π Kali ini, aku mau share salah satu resep favoritku yang tentunya super simple dan enak :) Semua bahan-bahanya belanja di GrabMart, aplikasih untuk sigap belanjakan Ramadhanüíö Ada diskon s.d. 15% + 50rb lho, dan tentunya sejam sampai tanpa perlu antri antri~\n\nBahan-bahan: 1 buah dada ayam (potong-potong), garam dan lada secukupnya, ¬Ω sdt bawang putih bubuk, ¬Ω sdt paprika bubuk, 100ml fanta orange, 100gr sdm tepung terigu, minyak untuk menggoreng\nSaus: 2 sdm madu, 2 sdm air lemon, 1 sdt kecap manis\n\nCara membuat:\n- Marinasi ayam dengan garam, lada, bawang putih bubuk, paprika bubuk, dan Fanta orange!\n- Baluri ayam dengan tepung, kemudian goreng sampai matang kecoklatan.\n- Campurkan semua bahan saus dan tuang ke ayam, aduk rata dan siap untuk disajikan dengan nasi hangat ~\n\n#orangechicken #takeawayfood #chickenrecipe #friedchicken #ramadhan #asmr #asmrfood #foodporn #viralrecipes #foodstagram #foodblogger #instafood #aesthetic #homecooking #homecook #homecooked #cookingvideo #homecookingvideo #foodaesthetic #cookingathome #onthetable #recipe #easyrecipes #easyrecipe #easyrecipesathome #resepsimple\n', 497, '2024-03-08 10:08:25', 0.00044621, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3319140656558768048', 5, 1, 4057),
(5237, '3319029184264618798', 'grabid', 14, 'https://www.instagram.com/p/C4Pj3VHP0Mu/', 'Lomba apa yang nggak bikin rugi? Berlomba-lomba dalam kebaikan dan berbagi bareng GrabMart Kilat, #apliKASIH untuk sigap belanjakan kebutuhan Ramadan kamu. Nah, GrabMart Kilat udah duluan kasih kamu diskon sampai Rp50rb, 30 menit sampai, dan masih banyak lagi diskon spesial Ramadan yang udah nungguin kamu. Nggak perlu lagi khawatir yaa, karena kebaikan bisa dimulai dari nyebarin diskonan!\n', 899, '2024-03-08 06:25:32', 0.000807089, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3319029184264618798', 9, 0, NULL),
