(5239, '3317791543166533562', 'grabid', 14, 'https://www.instagram.com/p/C4LKdSBPH-6/', 'Halooo, mau kasih tau aja nih‚Ä¶ Selama bulan Ramadan ini, Grab ganti jaket dulu, dari aplikasi jadi\n.\n.\n.\nAPLIKASIH\n\nSemua ini bisa terwujud karena banyak partner yang rela bekerja sama dengan Grab demi memberikan banyaaaaaaaak promo dan layanan.\n\nSupaya apaa? Supaya kamu bisa lebih sering kasih-kasih selama bulan Ramadan ini. Jadi tenang aja, selalu ada yang bisa kamu kasih-kasih.\n\nNaah, untuk kamu para pengasih, sekarang jangan ragu buat kasih-kasih, karena Grab sudah lulus jadi APLIKASIH UNTUK SESAMA.\n', 1481, '2024-03-06 13:29:10', 0.00141952, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3317791543166533562', 116, 1, 17539),
