(5241, '3314116144917223250', 'grabid', 14, 'https://www.instagram.com/p/C3-GxMqLZdS/', 'Seru banget deh, Pantun Battle bareng Ninik Soja, tapi akhirnya malah ngajak temenin ke Pikachu‚Äôs Indonesia Journey! üòÇ\n\nAyo deh berangkat! Seru juga bisa sambil nangkep Pikachu berkemeja batik! \n\nGak cuma itu aja, ada acara keren lainnya juga, nih! Mulai dari Pok√©mon Run, Pikachu Splash Show, Pikachu EDM, sampe Pok√©mon Kids Carnival. Seru banget, deh! Siap-siap buat serunya bareng-bareng di Bali, ya! Bahkan akan ada performance dari JKT48 juga loh!\n\nCatat ya! 2-3 Maret 2024! di Lapangan Renon, Denpasar!\n\nYuk, buruan beli tiketnya dan download game @pokemongoappid sekarang!\n\nOh iya, ada promo seru nih dari GrabCar, GrabBike, dan GrabFood, diskon sampai 90% loh! Caranya gampang, tinggal cari logo @grabid di Pokestop/Gym/Billboard sambil main Pok√©mon GO di sekitar area Pikachu‚Äôs Indonesia Journey. Jangan sampe kelewatan ya!\n\n#PokemonGO\n#PikachusIndonesiaJourney\n#PikachuBerkemejaBatik\n#PokemonAirAdventure\n#PokemonGOIndonesia\n#PokemonGOxGrab\n', 838, '2024-03-01 11:45:29', 0.000785756, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3314116144917223250', NULL, 0, NULL),
(5242, '3313440089283672584', 'grabid', 14, 'https://www.instagram.com/p/C37tDSySroI/', '#NgeRestoSeenaknya bisa langsung dapet diskon di tempat? GrabFoodies WAJIB tau ini!\n\nSekarang ada fitur Dine-in Discount di Dine-in Deals #GrabFood, bisa langsung dapet diskon s.d. 25%, lhoo üò±\n\nNggak perlu ribet-ribet, tinggal masukin total jajanan kamu, promo otomatis ter-apply dan kamu bisa langsung bayar ke kasir ü§ë\n\nEasy peasy lemon squeezy, dan pastinya makin hemat! Langsung aja ajak teman, pacar, keluarga kamu #NgeRestoSeenaknya di Dine-in Deals #GrabFood sekarang! ü•∞ü´∞üèª\n', 525, '2024-02-29 13:22:07', 0.000489764, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3313440089283672584', 26, 1, 4466),
(5243, '3309628395900249238', 'grabid', 14, 'https://www.instagram.com/p/C3uKX2sLiSW/', 'Sekarang udah tau kan produk yang pas buat kamu beli abis gajian?\n\nKalo udah mau abis, langsung restock. Kalo mau coba produk lain cek aja di GrabMart mumpung ada promo GrabJian GrabMart yang ngasih kamu diskon sampe Rp50rb dijamin fresh dan masih frozen terus cuma sejam sampai. Bisa belanja bulanan sambil lanjut rebahan deh! üí®\n\nKalo diskonnya segede ini, kamu mau beli apa? Tulis di kolom komentar yaa ‚òùüèª\n', 1701, '2024-02-24 07:07:51', 0.00156173, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3309628395900249238', 56, 0, NULL),
