(5245, '3309008384831207794', 'grabid', 14, 'https://www.instagram.com/p/C3r9ZgYpzly/', 'Apakah ibu-ibu emang suka update status gitu ya? ü§∑üèª‚Äç‚ôÄÔ∏è Daripada bengang bengong, mending ikutan GIVEAWAY GrabUnlimited Kaget Award yang berhadiah Nintendo Switch dan OVO Cash 300 ribu!\n\nCaranya gampang banget, kalian tinggal screenshot total saving GrabUnlimited di aplikasi Grab terus post di Instagram Story, masukkan ke highlight, lalu komen di sini kalo udah ikutan.\n\nLengkapnya, tonton sampai habis status mamakku ini!\n', 9446, '2024-02-23 10:36:56', 0.00849399, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3309008384831207794', 110, 1, 996309),
