(5249, '3305199804706914797', 'grabid', 14, 'https://www.instagram.com/p/C3ebbXvPwHt/', 'Nge-Grab sambil kuliah? Bisalahhh‚Ä¶üõµüéì\n\nTau kan mas Baskoro yang kemarin viral? Nah, kali ini beliau mau berbagi cerita nih di #CeritaDibalikKemudi tentang motivasi dalam menjalani hidup, dan bagi waktu buat kuliah sambil nge-Grab. Kuliahnya selesai sampai wisuda, rezekinya tetap lancar jaya. Semoga bisa jadi inspirasi buat temen-temen yang lain juga ya!üíö\n', 33473, '2024-02-18 04:30:07', 0.0299556, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3305199804706914797', 228, 1, 663118),
