(5255, '3295934850891904308', 'grabid', 14, 'https://www.instagram.com/p/C29g0jGPfU0/', 'FOMO pasti negatif? Nggak selalu sih. \n\nFear of missing out atau disingkat FOMO, takut ketinggalan sesuatu yang lagi rame, sering diasosiasikan sebagai sifat Gen Z, dan konotasinya nggak positif üòê\n\nPadahal, ini bisa banget dimanfaatkan, lho. Penulis muda, Erisca Febriani yang tulisannya sudah banyak diangkat jadi film justru merasa FOMO bisa jadi komoditas. Hahh, kok bisa?\n\n@eriscafebriani bilang, dengan bikin kegiatan positif yang seru dan rame, orang-orang bisa jadi penasaran dan ingin nyoba. Contohnya, ketika baca buku dikemas dengan kegiatan-kegiatan komunitas yang fun, bisa menarik banyak peminat baru dari kalangan muda yang penasaran. \n\nMahasiswi tingkat akhir di @ipbofficial ini juga nggak setuju kalau Gen Z dicap kurang sat set. Lahir di dunia yang lebih terbuka, terhubung secara global dan menghadapi jauh lebih banyak pilihan dibanding angkatan pendahulu, jadi faktor yang dirasa Erisca bikin Gen Z terkesan ragu dalam melangkah. Namun dipastikan semua itu bukan jadi penghalang, sebaliknya, bikin terbukanya banyak kesempatan. Setuju banget! üòç\n\nSaat ini Erisca sedang menggarap beberapa proyek, di antaranya adalah lanjutan seri Dear Nathan yang akan digarap menjadi film, dan buku seru yang akan mengangkat segala sesuatu hal khas dari era 2000an awal.\n\nSukses terus ya, Erisca! üëè\n\n#Generasi #GenerasiPercaya\n', 693, '2024-02-05 09:42:55', 0.000667537, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3295934850891904308', 58, 1, 7152),
