(5279, '3261886551296979415', 'grabid', 14, 'https://www.instagram.com/p/C1EjIlDrjHX/', 'Tanpa oven / panggangan khusus, tips bisa bikin Barbecue Brisket tetap lembut! Tonton videonya sampai akhir ya!\n\nIni dia menu andalanku pas masak besar saat perayaan Natal dan tahun baru, Barbecue Brisket. Pastinya spesial dan semua keluarga suka. Yang bikin spesial karena aku pakai bahan-bahan segar berkualitas belinya di GrabMart, mumpung lagi ada promo GrabMart Megahedon! Promo bundling s.d. 35% + diskon s.d. 50rb + gratis ongkir. Bisa banget buat stok kebutuhan snack / minuman soda buat perayaan akhir tahun.\n\nYuk rayain akhir tahunmu bersama teman atau keluarga bareng GrabMart¬†#Megahedon!\n\nResep Barbecue Brisket (untuk 10 porsi)\n\nBahan presto:\n2,2 kg daging sapi brisket\n5 lembar daun salam\n6 siung bawang putih, geprek\n50 gr jahe, geprek & iris\n3 liter air\n3 sdm garam\n2 sdm kaldu bubuk\n\nBahan bumbu halus:\n2 buah tomat merah\n60 gr bawang putih\n4 cm jahe\n10 siung bawang merah\n60 ml minyak\n\nBahan saus:\n80 gr saus tiram\n150 gr saus tomat\n150 gr saus bbq\n5 sdm kecap manis\n1 liter air\n\nBahan sambal chimichurri:\n5 siung bawang putih\n¬º buah bawang bombai\n7 buah cabai merah keriting\n15 buah cabai rawit hijau\n60 ml minyak panas\n1 sdt garam\n1 sdt gula pasir\n¬Ω sdt merica\n70 gr daun ketumbar\n1 buah lemon\n20 gr parsley\n50 ml olive oil\n\nBahan tambahan saus:\n2 sdm gula palem\n¬Ω buah lemon\n60 gr saus tomat\n125 ml air\n\nPelengkap:\nkentang goreng\njagung rebus\nsambal bawang\ntomat ceri\n\nLangkah:\n1. Siapkan presto, masukkan air, jahe, bawang putih, daun salam, daging, garam dan kaldu bubuk. Presto daging selama 70-80 menit\n2. Masukkan tomat, bawang putih, jahe dan bawang merah ke dalam blender, haluskan kemudian tumis hingga kering\n3. Tambahkan saus tomat, saus tiram, saus bbq, kecap manis dan air, aduk rata kemudian masukkan daging, masak selama 30 menit di api sedang kecil \n4. Tiriskan daging dan masukkan ke dalam kulkas sesaat sebelum di potong\n5. Masukkan air, gula palem, saus tomat dan perasaan lemon ke dalam saus, masak sesaat\n6. Untuk chimichurri, siapkan chopper masukkan bawang putih, bawang bombai, cabai merah keriting dan cabai rawit hijau, haluskan dan pindahkan ke dalam mangkuk\n', 59714, '2023-12-20 10:14:34', 0.0531585, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3261886551296979415', NULL, 0, NULL),
(5280, '3261228925491908394', 'grabid', 14, 'https://www.instagram.com/p/C1CNm3TLI8q/', 'Dalam misi menyelamati Jijah yang selalu bayarin ini itu, dari mulai makan sampe tagihan‚Ä¶\nKalaupun kepepet buat bayarin tagihannya, kalian wajib pakai Grab ya! Soalnya ada Diskon s.d 50rb, Min trx 150rb untuk pembelian tagihan di @GrabID pakai kode promo TAGIHANSAKHANSA cuman sampai 21 Desember 2023 aja. CATET wajib ikutin saran aku ya! #BayarTagihandiGrab\n', 16642, '2023-12-19 12:28:11', 0.0148574, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3261228925491908394', NULL, 0, NULL),
(5281, '3261017108098011664', 'grabid', 14, 'https://www.instagram.com/p/C1Bdcg-p1IQ/', '\"We need trust.‚Äù\n\nMusisi @JubileeMarisa, mahasiswi Universitas Brawijaya secara halus menepis pandangan generasi sebelumnya yang cenderung menggambarkan bahwa generasinya belum dewasa. Menurutnya, semua manusia, berproses, bertumbuh dan berkembang.\n\nJubi, panggilan Jubilee, sudah merilis 4 lagu di semua platform streaming musik. Dia adalah bagian dari generasi yang sejak lahir dekat dengan teknologi dan juga media sosial. Beda dengan generasi sebelumnya, akses untuk bermusik dan menerbitkan karya jauh lebih dimudahkan, tapi ini juga berarti kompetisi yang sangat besar karena semua akan berebut audiens. Menurut Jubi, di antara banyak syarat penting dalam berkarya adalah mengutamakan kejujuran dan ketulusan.\n\nLahir di keluarga musisi, tumbuh di rumah yang tidak pernah sepi dari musik, sahabat menyebut Jubi ‚Äúlahir di atas gitar‚Äù. Walau demikian, bermusik adalah murni pilihan Jubi, bukan atas dorongan keluarga. Menurut Jubi, genre musiknya adalah ‚Äúbedroom pop‚Äù. Sejak kecil, musik menjadi jendela juga jembatan, yang memungkinkannya berekspresi jujur tanpa pretensi, menembus ruang apapun yang menjadi pemisah.\n\nJubilee Marisa membuka episode perdana #Generasi, yang akan dihadirkan Grab setiap bulan untuk mengangkat bakat-bakat muda Indonesia, baik karya maupun opininya. \n\nSemua materi audio & visual pribadi digunakan dengan izin pemilik.\n\n#Percaya #GenerasiPercaya\n', 2120, '2023-12-19 05:27:04', 0.0019395, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3261017108098011664', 62, 1, 40914),
