(5284, '3260249377694069245', 'grabid', 14, 'https://www.instagram.com/p/C0-u4kUpLH9/', 'Panggilan buat semua warga wargi buat belanja sepuasnya di akhir tahun bareng kolaborasi GrabMart beserta jajaran brand hingga UMKM dengan buanyaaak promo dan diskon!\n\nBorong semua kebutuhan, ada promo bundle s.d. 35% + diskon s.d. Rp50rb + ongkir hemat juga. Temukan dari yang serba segar, camilan, minuman dan berbagai keperluan lainnya untuk tahun baruan~\n\nTunggu apa lagi? Yuk, cek GrabMart Megahedon sekarang üéä\n', 148, '2023-12-18 04:00:00', 0.000131552, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3260249377694069245', 0, 1, 1753),
(5285, '3259675448294303946', 'grabid', 14, 'https://www.instagram.com/p/C08sYy6pOjK/', 'Menjelang akhir tahun, waktu yang tepat buat kumpul-kumpul bareng teman dan keluarga ü•∞\n\nBiar momen ngumpul makin seru, jangan lupa buat makan, jajan, dan belanja sepuasnya! \n\nAda diskon s.d. Rp150rb dari #GrabFood, bisa lebih hemat kalau pilih opsi pengantaran hemat! Nggak ketinggalan juga diskon s.d. Rp50rb dari #GrabMart dengan ongkir yang pasti hemat üòâüíØ\n\nRayakan momen akhir tahun dengan mega diskon yang heboh cuma di Grab #Megahedon! üéâ\n', 21511, '2023-12-17 09:00:00', 0.0191772, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3259675448294303946', 64, 1, 630549),
