(5288, '3258384628807166824', 'grabid', 14, 'https://www.instagram.com/p/C04G45lpOto/', '‚ö†Ô∏èGIVEAWAY ALERT‚ö†Ô∏è\nBaca captionnya sampe selesai yah üòé\n\nKeseruan Donta & Moots The Explorer! \nApakah mereka harus ke tempat lain? üòÇ\n\nDonta & Moots jalan-jalan keliling Jabodetabek nih! \nSiapa yang kemarin ketemu mereka? Donta & Moots jalan-jalan ke tempat seru dari Panduan Liburan Seru (https://grb.to/liburanbisadiatur) yang ada di aplikasi Grab loh. Buruan cek juga deh buat kalian yang mau liburan bareng keluarga, temen ataupun sendirian bisa kok.\n\nBuat kalian yang mau liburan tapi sambil dapet hadiah, ikutan Liburan Seru Challenge yuk. Bisa dapet iPhone 15 dan OVO Cash juga loh. Caranya: \n1. Wajib follow Instagram & TikTok @GrabID\n2. Post video mini vlog kamu pakai GrabCar XL / GrabBike / GrabCar Rental / GrabCar Premium Airport dan fiturnya ke destinasi liburan yang mau kamu rekomendasiin di Instagram / TikTok\n4. Jangan lupa pakai hashtag #LiburanBarengGrab dan mention @GrabID ya.\n\nIni dia syarat & ketentuannya:\n1. Periode kompetisi dimulai tanggal 15 Des 2023 - 5 Jan 2024\n2. Kompetisi ini dapat diikuti oleh semua pelanggan Grab di seluruh Indonesia\n3. WAJIB follow akun Instagram & TikTok @GrabID\n4. Posting video mini vlog kamu saat menggunakan salah satu layanan Grab berikut (GrabCar XL / GrabBike / GrabCar Rental / GrabCar Premium Airport) ke destinasi liburan yang mau kamu rekomendasikan üòâ\n5. Durasi video maksimal 90 detik\n6. Posting video kamu di Instagram / TikTok. Jangan lupa pakai hashtag #LiburanBarengGrab & mention @GrabID\n7. Pastikan akun kamu tidak di private & jangan hapus postingan kamu hingga 12 Jan 2024 ya üëÄ\n8. 3 (tiga) orang pemenang dengan konten terbaik berhak mendapatkan masing-masing satu unit iPhone 15\n9. 10 (sepuluh) orang pemenang lainnya masing-masing berhak mendapatkan hadiah OVO Cash sebesar 500 ribu\n10. Keputusan tim Grab bersifat mutlak & tidak dapat diganggu gugat. Adanya penyalahgunaan informasi dalam partisipasi kompetisi bisa mengakibatkan diskualifikasi.\n11. Pihak Grab berhak untuk menggunakan konten dari para pemenang sebagai hak milik.\n\nSiapa yang mauu? Buruan cek yaaa!!!!üëÄ\nLiburan bisa di A-Tur\n#LiburanBarengGrab\n', 55520, '2023-12-15 14:18:44', 0.0498244, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3258384628807166824', 534, 1, 2260379),
