(5300, '3252420701267159806', 'grabid', 14, 'https://www.instagram.com/p/C0i62VPJ-r-/', 'Nggak usah panik kalo kepepet, kan ada GrabExpress!\n\nMau kirim hampers natal, kado hari ibu, atau paket apapun itu? Pake yang CEPET & BERES aja üòâ\n\nOngkirnya mulai 5 ribu aja lhooo~\n', 194, '2023-12-07 08:46:42', 0.000185773, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3252420701267159806', 15, 1, 3190),
(5301, '3250766864560505645', 'grabid', 14, 'https://www.instagram.com/p/C0dCz1xvUMt/', 'Ada kabar seru untuk kita semua nih.\n\nTau Ndarboy Genk ngga? Itu lho, penyanyi Mendung Tanpo Udan yang viral dan dance nya sampai diikuti artis Kpop di TikTok?\n\n@ndarboy_genk hari ini merilis single ‚ÄúModal Percoyo‚Äù, hasil kolaborasi bareng Grab dan OVO. \n\nAda cerita menarik  di balik lagu ini. Mas Daru (Vokalis Ndarboy Genk) ternyata dulunya pernah jadi mitra driver Grab. Ini baru ia ungkapkan waktu tampil di Hari Mitra Grab tahun lalu di Jogja. Nah, berangkat dari situ Ndarboy Genk terinspirasi untuk menciptakan lagu Modal Percoyo sebagai bentuk apresiasi kepada mitra driver Grab di seluruh Indonesia. Di lagu ini Mas Daru curhat tentang perjuangan dan kegigihan dirinya dan para driver ojol dalam menghadapi tantangan demi menghidupi keluarga. \n\nLagu ‚ÄúModal Percoyo‚Äù sekarang sudah bisa dinikmati di Youtube Ndarboy Genk dan platform musik favorit kamu. Untuk lebih mudahnya bisa klik link di bio. Yuk kita dengerin. Dijogetin juga boleh!\n\n#ModalPercoyo #ModalPercaya #NdarboyGenk #Grab #OVO\n', 66016, '2023-12-05 02:00:00', 0.0590819, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3250766864560505645', 453, 1, 1403192),
