(5303, '3250223446582117779', 'grabid', 14, 'https://www.instagram.com/p/C0bHQEWLEWT/', 'Apa-apa pesannya GrabBike Hemat & GrabCar Hemat, ke sana-sini, sini-situ pesan lagi. \n\nHeran, bisa segampang dan sesering itu karena Paling Hemat buat anterin ke mana aja. Ditambah ada Ekstra Cashback cuma dengan ikutan Sobat Hemat Challenge di Aplikasi Grab lho ü§©\n\nIni baru #SobatHemat, cobain deh~\n', 194, '2023-12-04 08:01:11', 0.000191995, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3250223446582117779', 22, 1, 3628),
(5304, '3249423283126697950', 'grabid', 14, 'https://www.instagram.com/p/C0YRUKDpn_e/', 'Satukan keberagaman, rayakan kekuatan dalam perbedaan. Bersama-sama kita bangun Indonesia yang inklusif dan #setara bagi semua. \n\nSelamat Hari Disabilitas Internasional 2023.\n\n#PercayaSETARA\n', 1014, '2023-12-03 05:31:02', 0.000955529, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3249423283126697950', 61, 0, NULL),
