(5307, '3240170529822162113', 'grabid', 14, 'https://www.instagram.com/p/Cz3Ze4BvTzB/', 'Ada yang manis namun kali ini bukan senyummu, ini Oatside Choco Black Forest & Choco Marshmallow dari Kopi Kenangan!\n\nPerpaduan rasa manis dan kenyal dari Choco Marshmallow siap nemenin sore kamu hari ini. Eh, kalo mau yang polosan bisa cobain Oatside Choco Black Forest ya ges ya~\n', 346, '2023-11-20 11:07:28', 0.000455987, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3240170529822162113', 167, 0, NULL),
(5308, '3229097284414445280', 'grabid', 14, 'https://www.instagram.com/p/CzQDt8ms5bg/', 'Grab Indonesia & @ovo_id  umumkan donasi untuk Korban Konflik Gaza (Palestina), melalui @benihbaik.\n', 31403, '2023-11-05 04:26:54', 0.0397651, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3229097284414445280', 13334, 0, NULL),
(5309, '3226979555309079291', 'grabid', 14, 'https://www.instagram.com/p/CzIiM7rpUr7/', 'Kalo udah percaya sama sesuatu, semua pasti bisa ngejalaninnya seberat apapun beban yang lagi kita bawa. Kita semua bisa jadi orang tua, bisa jadi tulang punggung, bahkan kita #SemuaBisaJadiPahlawan versi kita sendiri buat diri sendiri dan keluarga. \n\nTerima kasih buat kamu yang udah pake jasa mereka, mulai dari GrabBike, GrabFood, sampe GrabMart dan MS GLOW juga. \n\nOiya, @msglowbeauty @mscosmeticofficial sudah tersedia di GrabMart, loh! Siap diantar, #SejamSampai!\n\nNah, menurut kamu, arti pahlawan versi kamu itu apa? Tulis di kolom komentar, ya!\n', 25266, '2023-11-02 06:22:14', 0.0265602, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3226979555309079291', 4615, 1, 725023),
(5310, '3226407718009172621', 'grabid', 14, 'https://www.instagram.com/p/CzGgLmsg_KN/', 'Apa yang lebih gede dari Megalodonü¶à hayo? Mega diskon di Grab Megahedon!\n\nNikmati parade diskon kolaborasi Grab dengan banyak brand tenar dan UMKM kesayangan. Di sini, kamu bisa jajan serta belanja sesukamu dan tetap hemat. Jajan semaunya di GrabFood? Ada diskon s.d. Rp150rb dan Pengantaran Hemat!\n\nBelanja sepuasnya di GrabMart? Tenang, ada promo s.d. Rp50rb dan ongkir hemat!\nMeriah, kan? Nikmati akhir tahun dengan promo dan diskon di Grab Megahedon! üéâü•≥\n', 1548, '2023-11-01 11:23:31', 0.00182573, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3226407718009172621', 506, 1, 49073),
(5311, '3225655134959479606', 'grabid', 14, 'https://www.instagram.com/p/CzD1EFHLKs2/', 'Niatnya sih ngeprank Halloween, eh malah diprank balik üëª\n\nYang jelas nggak ngeprank mah cuma Langganan Ongkir Unlimited-nya GrabExpress! Ada diskon ongkir sampe 50% lagi tiap kirim paket üì¶\n\nCus langganan biar gak dikejar hantu aslinya..... üßü‚Äç‚ôÄÔ∏è\n', 1271, '2023-10-31 10:29:47', 0.00134574, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3225655134959479606', 243, 1, 29756),
(5312, '3225535834835247896', 'grabid', 14, 'https://www.instagram.com/p/CzDZ8CNpeMY/', 'Temen kamu bisa ngonser dan self reward terus?? Kok bisa ya?\n\nEits, jangan berprasangka buruk dulu dong. Siapa tau mereka bisa saving gara-gara langganan #GrabUnlimited jadi bisa dapet diskon jalan dan gratis ongkir berkali-kali.\n\nBuruan langganan biar bisa ikutan saving juga, Gratis untuk 8 minggu pertama~\n', 211, '2023-10-31 06:34:02', 0.000241771, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3225535834835247896', 61, 1, 8817),
(5313, '3224914180312623598', 'grabid', 14, 'https://www.instagram.com/p/CzBMlxUp2nu/', 'Ketinggalan barang kamu di GrabCar? \nTenang, enggak  perlu panik.\nAda ‚ÄúPusat Bantuan‚Äù, Bisa DM Mimin juga di sini, atau bisa hubungi Mitra Pengemudi setelah perjalanan berakhir. \nSelalu cek lagi barang bawaan kamu ya ü•∞\n', 25705, '2023-10-30 09:59:29', 0.0229976, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3224914180312623598', 168, 1, 1071130),
(5314, '3224797540805557441', 'grabid', 14, 'https://www.instagram.com/p/CzAyEcURLzB/', 'Guys, Bram berhasil saving dan dapet tumbler hits gara-gara udah subscribe #GrabUnlimited 2 bulan.\nBuat kalian yang kemana-mana atau beli apapun make Grab, kata gue sih langganan sekarang, siapa tau dari hasil saving itu bisa buat beli barang inceran kalian~\n', 30798, '2023-10-30 06:04:51', 0.027673, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3224797540805557441', 335, 1, 354663),
(5315, '3224005623133671366', 'grabid', 14, 'https://www.instagram.com/p/Cy9-Ahgvo_G/', 'Pesta Warga hari pertama seru bat, pak. Rumah Seram rame bener tadi, kayaknya emang lebih serem daripada rumah2 hantu biasanya. Bisa sampe asam lambung!!! Mangkanya jangan lupa makan yah nanti. Di sini banyak booth makanan enak2, pesen pake GrabFood atau pake OVO biar dapet diskon dan dapet kesempatan menang Raffle PS5 dan emas batangan!!!\n', 853, '2023-10-29 03:55:27', 0.0007902, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3224005623133671366', 36, 1, 26657),
(5316, '3223255772670224940', 'grabid', 14, 'https://www.instagram.com/p/Cy7Tgw2PGos/', 'Setuju nggak sih, generasi muda memiliki tantangan sendiri? Dan berkarya serta seni jadi salah satu nilai tambah untuk aktualisasi diri di era digitalisasi dan ketatnya persaingan. \n\nMimin yakin ada banyak anak muda berbakat di sini yang jago nyanyi, acting, atau punya opini dan meminati jurnalistik, tapi merasa insecure karena kompetisi yang berat, jadi butuh dukungan dan dorongan untuk mewujudkan potensi.\n\nBertepatan dengan Hari Sumpah Pemuda, Grab Indonesia dan OVO memperkenalkan \"Generasi\", sebuah inisiatif yang berupaya membantu membuka panggung yang lebih luas bagi anak muda berbakat di bidang seni, kreasi, dan jurnalistik yang belum terlihat karena ramainya persaingan. \n\nDengan memanfaatkan ekosistem Grab dan OVO, lewat \"Generasi\", para generasi muda ini tak hanya mendapatkan sorotan yang seharusnya, namun juga berkesempatan untuk makin berdaya, mendorong potensi diri dengan ragam edukasi hingga workshop untuk bertukar pikiran dengan sosok-sosok terbaik Indonesia.\n\nNantikan segera di @grabid dan @ovo_id!\n', 226, '2023-10-28 03:00:00', 0.000224883, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3223255772670224940', 27, 1, 3485),
(5317, '3222839271872688218', 'grabid', 14, 'https://www.instagram.com/p/Cy50z4QJnBa/', 'Kalian masih antri lama di supermarket? Mending belanja bulanan #CariPakaiGrabMart Kilat!\n\nMurah banget ada diskon s/d 50rb, plus 30 menit sampai üòâ Yuk belanja sekarang!\n', 5740, '2023-10-27 13:14:23', 0.00523097, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3222839271872688218', 145, 1, 726400),
(5318, '3222638481100754229', 'grabid', 14, 'https://www.instagram.com/p/Cy5HJ_Rg801/', 'DISKONNYA WADIDAW HEMATNYA WOWü•≥\n\nUdah ikutan makan gratis #WajibKepoin ? Nah, besok waktunya kita rayakan dengan jajan di Diskon Kilat GrabJian #GrabFoodID !\n\nPuas jajan semua menu kesukaanmu dengan diskon s.d 90% dari jam 2 - 4 sore dan diskon s.d 40% atau 50% + gratis ongkir GrabUnlimited di jam tertentu.\n\nBuruan serbu #DiskonKilatGrabFood cuma 1 hari aja di tanggal 28 Oktober. Pastiin kebagian, cus jajan!\n', 16168, '2023-10-27 06:48:00', 0.0146965, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3222638481100754229', 366, 1, 714261),
(5319, '3222642232934555983', 'grabid', 14, 'https://www.instagram.com/p/Cy5IAlcPGFP/', 'Halloween Party Di Rumah Aja!üéÉ\n\nApa sih kegiatan yang paling kalian tunggu-tunggu saat halloween? Kalau aku, jelas bagian baking dan makan bareng teman-teman sambil nonton atau cerita kisah-kisah horrorüëª Sebagai konten kreator, menurutku kelupaan beli bahan untuk ngonten adalah salah satu hal terhorrorü•≤ Tapi itu dulu! Kalau sekarang tentu saja udah santai dong, karena tinggal #CariPakaiGrabMart dan pasti sejam sampai!ü´∂\n\nUntuk potluck party nanti, cobain deh bikin Spooky Halloween Strawberry Pastry ini!üçì jadi buat kaum mageran bisa langsung scroll and click!üòâ \n\nBikinnya super simple, kalian cuman perlu masak strawberry dan gula sampai mengental menjadi selai dan tuang 1 sdm ke atas puff pastry yang sudah dicetak, lalu ditutup dengan puff pastry lagi. Olesi dengan kuning telur dan taburi gula, lalu panggang sampai matang! Mudah banget kan?!üòÜ\n\nJangan lupa dicoba dan tag aku kalau kalian juga bikin yaü•∞\n', 334, '2023-10-27 06:42:40', 0.000306658, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3222642232934555983', NULL, 0, NULL),
(5320, '3221116305719935163', 'grabid', 14, 'https://www.instagram.com/p/CyztDa-p8C7/', 'ü§ë Hore, gajian time! Gak perlu takut mau jalan ke mana aja. Biar pasti hemat, pake kode promo GRABJIAN ya untuk diskon s.d. 50% saat pesan GrabBike/GrabCar. Mau ke mana pun tujuannya, pengeluaran tetap aman~\n\nNih promo khusus buat kamu yang di Jabodetabek ya guys! üí∏üöóüõµüéâ\n', 6411, '2023-10-25 04:11:09', 0.00576873, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3221116305719935163', 79, 1, 351305),
(5321, '3220711070943214125', 'grabid', 14, 'https://www.instagram.com/p/CyyQ6ervPot/', 'Udah gajian tetep harus hemat loh guys! \n\nVersi hemat aku pas gajian gini langsung pake Grab, karena #GrabJian datang lagi!! \nSemua pasti diskon waktu gajian di Grab sampai dengan 250rb!!! üíöüíö Aku spill di sini ya promonya:\n\n- GrabBike & GrabCar diskon s/d 50%. Kode: GRABJIAN\n- GrabExpress kirim pake Instant, diskon ongkir s/d 70rb. Kode: YUKGRAB\n- GrabFood diskon s/d 250rb\n- GrabMart diskon s/d 50rb. Kode: GRABJIANMART\n- GrabMart Kilat diskon 3% s/d 50rb\n- GrabKios diskon pulsa & tagihan s/d 100rb\n- GrabGifts, kirim GrabGifts bonus voucher s/d 35rb\n- OVO cashback s/d 20rb OVO Points Top Up e-Money\n\nHemat banget kan? \nTag temen kalian, biar mereka tau juga¬†promonya¬†ya!\n', 11841, '2023-10-24 14:45:29', 0.0106264, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3220711070943214125', NULL, 0, NULL),
