(5331, '3212638310245903955', 'grabid', 14, 'https://www.instagram.com/p/CyVlYWaBK5T/', 'NgeGrabFood jauh dekat, ongkirnya dijamin hemat üëç\n\nGak perlu worry mikirin ongkir saat pesan makan dari jarak jauh atau dekat. Pakai rumus #HematematikaGrabFood, ongkirnya paling hemat mulai 3ribuan. Pas di kantong, gak bikin dompet bolongü§≠.\n\nYuk, buktikan rumus hemat #ngeGrabFood sekarang!\n', 5476, '2023-10-13 11:26:34', 0.00492609, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3212638310245903955', 66, 1, 651529),
(5332, '3212439764622201474', 'grabid', 14, 'https://www.instagram.com/p/CyU4PIYpVKC/', 'Buat kamu yg masih sekolah atau kuliah, pernah gak sih ngerasa gak pede sama bakat sendiri? Atau khawatir passion kamu sekarang gak bisa jadi karir di masa depan? Hmmm ü§îü§îü§î\n\nJadi, beberapa waktu lalu, Grab Indonesia memfasilitasi talkshow bertema ‚ÄúMendobrak Stigma: Seni dan Peluang Kerja‚Äù bersama teman-teman mahasiswa Universitas Brawijaya, Malang. Acaranya seru banget gaes! ‚ú®\n\nAda @theodrematthew dan @jubileemarisa sebagai perwakilan dari mahasiswa dan penggiat seni. Ada @nicholassaputra juga yang spesial hadir membawa sudut pandang pekerja seni senior. Pastinya auto heboh yaa kedatangan Nicsap! ü§© \n\nTeman-teman di sana juga antusias banget pas sesi interaktif dengan para narasumber. Pertanyaan yang diajukan teman-teman cukup kritis dan relevan. Salah satunya soal gimana caranya mengatasi insecurity atas karya sendiri, di mana Nico menekankan pentingnya berada dalam komunitas yang supportive juga konstruktif.\n\nSemoga sesi ini bisa menginspirasi anak-anak muda lain untuk terus semangat menggali passion dan berkarya yaa! ü•∞\n', 579, '2023-10-13 04:52:50', 0.000550207, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3212439764622201474', 40, 1, 11270),
(5333, '3211029886158748155', 'grabid', 14, 'https://www.instagram.com/p/CyP3qsvp7n7/', 'Pengalaman yang gak akan terlupakan buat aku bisa dinner bareng sama para pemenang challenge #KejarRefal dan juga nyetirin mereka jalan-jalan. \n\nThank you Grab udah mewujudkan mimpiku buat bisa sedeket ini sama mereka. Pake terus GrabCar dan GrabBike, siapa tau bisa aku setirin dan dinner bareng juga üòé\n', 11287, '2023-10-11 06:10:43', 0.0101615, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3211029886158748155', 145, 1, 399140),
