(5335, '3208854094137822682', 'grabid', 14, 'https://www.instagram.com/p/CyII8whJI3a/', 'Selalu takjub sama energi para Mitra Grab & OVO kalau lagi kumpul begini üòç\n\nPerayaan tahunan ini dihadiri lebih dari 1.000 Mitra yang datang dari Aceh hingga Papua. Di Hari Mitra Grab & OVO 2023 yang diselenggarakan di Surabaya ini para Mitra menikmati hari dengan sajian kuliner, permainan berhadiah dan berbagai hiburan.¬†\n\nBukan hanya jadi ajang untuk bisa berdendang dan berjoget bareng @ndarboy_genk dan @wikasalim, #HariMitraGrab juga jadi puncak perayaan Apresiasi Dana Abadi yang secara total menyalurkan Rp16,2 Miliar pada lebih dari 46.000 pejuang Transportasi dan pelaku UMKM, termasuk para Mitra Grab & OVO ü§©\n\nKira-kira, tahun depan HMG mau diadain di kota mana ya? ü§î\n', 428, '2023-10-08 06:08:32', 0.000406211, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3208854094137822682', 29, 1, 5016),
