(5337, '3207484158668947020', 'grabid', 14, 'https://www.instagram.com/p/CyDRdksJ75M/', 'Selamat kepada 1.158 pelajar penerima beasiswa GrabScholar mulai dari jenjang SD, SMP, SMA/K, hingga Universitas. \n\nSetelah melalui seleksi ketat, para pelajar dari 138 kota/kabupated di Indonesia tersebut berhak atas bantuan dana pendidikan dari Grab dan OVO.\n\nMelalui pendidikan, mimpi dan harapan bisa diwujudkan. \n\nGrabScholar merupakan salah satu dari komitmen berkelanjutan Grab Indonesia dan OVO yang merupakan bagian dari program Apresiasi Dana Abadi, di mana pengumumannya dilakukan kemarin di Hari Mitra Grab & OVO 2023 yang dilaksanakan di Surabaya. \n\nNantikan informasi selanjutnya mengenai pendaftaran seleksi beasiswa GrabScholar di periode mendatang ya!\n', 390, '2023-10-06 08:47:31', 0.00036799, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3207484158668947020', 24, 1, 5454),
