(5339, '3204416966310193319', 'grabid', 14, 'https://www.instagram.com/p/Cx4YEDNJ2in/', 'Selamat Hari Batik Nasional!\n\nTahu nggak, kalau 2 Oktober diperingati sebagai Hari Batik Nasional oleh UNICEF, lho!\n\nLebih dari tekstil tradisional, batik merupakan warisan budaya Indonesia yang sudah mendunia. Corak ragam batik pun mengandung makna dan filosofi berbeda dari tiap ragam dan asal daerah. ‚ú®\n\nOh iya, baju batik kontemporer yang dikenakan perwakilan Grab di foto ini merupakan baju rancangan dari @didietmaulana dengan label @sarupa_byikatindonesia! Bagus ygy? üòç\n\nKamu pakai batik apa hari ini? Pap di stories dong, mention @grabid, ya. Nanti mimin kirimin OVO cash buat dua orang! Yukk. ü§©\n\n#HariBatikNasional\n#BatikIndonesia\n#WarisanBudaya\n#Indonesia\n', 473, '2023-10-02 03:11:31', 0.000437321, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3204416966310193319', 19, 0, NULL),
