(5351, '3197959039911000245', 'grabid', 14, 'https://www.instagram.com/p/Cxhbs2kJPi1/', 'Siapa di sini yang tertarik mencoba belajar Bahasa Isyarat?\n\nSepanjang minggu ini, Mitra Pengemudi Grab di beberapa kota besar ikutan workshop Bahasa Isyarat bareng @gerkatin_pusat dan @pusbisindo \n\nSeneng banget ternyata Mitra Pengemudi yang merupakan Teman Dengar pun antusias untuk belajar memahami Teman Tuli dengan langkah sederhana seperti mempelajari Bahasa Isyarat dasar yang biasa digunakan saat ambil orderan.\n \nKeseruan workshop ini juga dilanjutkan secara online agar dapat menjangkau ribuan Mitra Pengemudi dan menjadi pembelajaran yang dapat terus diakses sehingga Teman Tuli yang menggunakan layanan Grab bisa merasa lebih nyaman dan dimengerti. \n\nMari kita terus dukung penggunaan Bahasa Isyarat sehingga bisa tecipta kesetaraan yang nyata bagi semua orang.\n\nSelamat Hari Bahasa Isyarat Internasional!\n\n#PercayaSETARA\n', 607, '2023-09-23 05:22:18', 0.00055554, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3197959039911000245', 18, 1, 8186),
