(5353, '3197405318575634489', 'grabid', 14, 'https://www.instagram.com/p/CxfdzJYpTg5/', 'Yang merasa beban hidupnya berat sini merapaaaaat! üòÆ‚Äçüí®\n\nUdah diingetin sama Ade Manggarai alias Rina Nose nih, ada diskon s.d. 50% tiap  kirim-kirim paket üì¶ Beban berkurang, hidup pun semakin mudaah~\n\nYuk langganan Ongkir Unlimited GrabExpress sekarang!\n', 19850, '2023-09-22 11:06:29', 0.0179071, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3197405318575634489', 296, 1, 1314214),
(5354, '3197307124619866229', 'grabid', 14, 'https://www.instagram.com/p/CxfHePIyvB1/', 'Dalam rangka menyambut Hari Tani yang jatuh pada tanggal 24 September, hari dimana kita mengapresiasi perjuangan golongan petani di Indonesia, pertama kalinya, lewat ilustrasi; menciptakan 5 halaman cerita perjalanan hasil tani dari perkebunan sampai kita nikmati di rumah kita. Geser ke kiri dan teman-teman bisa menikmati detail segarnya sayur dan buah sampai lezatnya hidangan tradisional di meja makan (pertama kalinya juga gambar makanan dengan serius). \n\nPun jika teman-teman ingin ikut serta menikmati luasnya ragam macam hasil tani nasional, bisa langsung #CariPakaiGrabMart yang menyediakan berbagai pilihan kebutuhan. Mau cari apapun, ada! Oiya juga dengan diskon sampai dengan 30rb + gratis ongkir, sejam sampai!\n', 12509, '2023-09-22 07:45:32', 0.0112059, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3197307124619866229', 98, 0, NULL),
(5355, '3197266406400432216', 'grabid', 14, 'https://www.instagram.com/p/Cxe-NtVyZhY/', 'Hai para NCTzen, ELF, Cassiopeia, ReVeluv, MY! Siap nonton SMTOWN Live 2023 dengan lebih asik, aman, dan nyaman?\n\nPastinya dengan #NaikMRTkeGBK karena MRT Jakarta akan beroperasi hingga pukul 01:30 WIB pada 23 September 2023, lho!\n\nUntuk menemani mobilitas kamu yang akan nonton SMTOWN Live 2023 dan menyaksikan penampilan artis kesayangan kamu dari SUPER JUNIOR, TVXQ, Red Velvet, NCT Dream, NCT 127, WayV, aespa dan RIIZE langsung di Stadion Utama GBK.\n\nSerunya, dari dan menuju Stasiun MRT bisa lebih hemat naik @grabid dengan gunakan kode promo YUKGRABMRT untuk GrabBike, atau paket GrabUnlimited untuk hemat hingga 20% naik GrabCar!\n\nBuruan kasih tau teman-teman kamu biar gak ketinggalan info penting ini, ya!\n\n#MRTJakarta\n#UbahJakarta\n#JagaGBK\n#TransportasiUmumkeGBK\n', 1287, '2023-09-22 06:34:48', 0.00117241, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3197266406400432216', 32, 1, 25612),
(5356, '3196459388839530085', 'grabid', 14, 'https://www.instagram.com/p/CxcGuDqvg5l/', 'Dilema udah jadi bapak bapak harus menuhin kebutuhan istri ama anak yee. Untung sekarang udah ada semua di Grab sekalian #BeliVoucherGameDiGrab sekaligus pulsa.\nMana pas banget lagi ada promo total cashback sampai dengan 30.000 OVO Points, min pembelian 25rb. Terus punya kesempatan buat dapet  25 Elite atau 25 Special eksklusif MLBB Skin untuk 50 pembeli pertama. Kaga perlu ribet keluar rumah dah kalo mau top up voucher game!\n\nVouchernya hanya berlaku utk pengguna android dan berlaku sampai akhir September. Ahh mantap..\n', 4996, '2023-09-21 03:47:24', 0.00446032, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3196459388839530085', 22, 1, 62346),
(5357, '3196039082247794277', 'grabid', 14, 'https://www.instagram.com/p/CxanJyppS5l/', 'Sering terjadi nih di kota-kota besar...üòÆ‚Äçüí®\n\nKebanyakan yang diurus, jadi suka lupa harus ngapain aja! Untung ada GrabJastip si Andalan Mama Milenial ü§≠üëåüèª\n\nCuuus titip beli apa aja pake kode promo ‚ÄúJASTIP‚Äù buat dapetin diskon s.d. 30 ribu! Sikaaat moms üí®\n', 48993, '2023-09-20 14:18:58', 0.0436797, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3196039082247794277', 148, 1, 1810305),
(5358, '3193006538428276279', 'grabid', 14, 'https://www.instagram.com/p/CxP1oeIhF43/', 'Karena beberapa bulan terakhir sering travel dan cobain banyak kopi, gua jd kebiasaan ngopi pagi. Nah buat lu yang suka ngopi juga, apalagi penikmat Kopi Tuku, ada kolaborasi #PercayaProjex dari Grab x Toko Kopi Tuku. Jadi, setiap order dari Toko Kopi Tuku di GrabFood, itu sama aja udah donasi Rp 2.000-5000.\n\nPeriode nya dari 18 Agustus 2023-22 September 2023!\n#GuyubPercaya\n\nNgopi sambil donasi sih sabi dah\n', 2812, '2023-09-16 09:22:25', 0.00261771, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3193006538428276279', 133, 1, 34166),
(5359, '3191533346025289972', 'grabid', 14, 'https://www.instagram.com/p/CxKmqsyprj0/', 'Siapa nih yang suka banding-bandingin harga kaya gini sama temen sendiri? ‚úãüèª\n\nNih kata aku sih mendingan langganan #GrabUnlimited aja, soalnya gratis ongkir Rp10rb tiap jajan di GrabFood/GrabMart plus dapet diskon 15% tiap order GrabBike/GrabCar. Gratis langganan buat 8 minggu pertama, rugi banyak nggak sih kalo nggak langganan?‚ú®\n', 256, '2023-09-14 08:34:55', 0.000299547, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3191533346025289972', 81, 1, 5315),
(5360, '3191352298968630256', 'grabid', 14, 'https://www.instagram.com/p/CxJ9gHlJsPw/', 'Udah nggak perlu angkat-angkat beban, sekarang mah cukup langganan Paket Ongkir Unlimited GrabExpress aja biar punya superpower!\n\n Kirim paket kemanapun dan kapanpun nggak perlu takut boncos ongkirnya karena ada diskon s.d. 50% tiap kirim üòéüí™üèª\n\nCoba deh langganan sekarang dan buktiin sendiri #ThePowerofLangganan !\n', 12364, '2023-09-14 02:34:48', 0.0110415, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3191352298968630256', 58, 1, 1332179),
(5361, '3190831041471198826', 'grabid', 14, 'https://www.instagram.com/p/CxIG-0tLjZq/', 'Bapak driver gantiin aku jadi content creator & bagi2 rezekiiii???\n\nGuyssss tau gaksi, ternyata lewat ngopi kita bisa ngasih impact ke sekeliling kita?\n\nGak sendiri, tapi lewat kolaborasi Grab X Toko Kopi Tuku. Gak cuma bisa ngopi, sekarang kalian bisa langsung berdonasi abis order minuman favorite di Tuku via GrabFood  sampai tanggal 22 September 2023!!!\n\nKarena bareng #PercayaProjex, kalian bisa makin guyub bareng tetangga. #GuyubPercaya\n', 1598, '2023-09-13 09:20:22', 0.00152351, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3190831041471198826', NULL, 0, NULL),
(5362, '3187739758021278683', 'grabid', 14, 'https://www.instagram.com/p/Cw9IGupP3vb/', 'Kalo calon kalian minimal harus punya berapa M nih wak? üòÇ\n‚Ä¢‚Ä¢‚Ä¢\nTapi dari pada kelamaan nunggu pujaan hati punya uang milyaran buat jajan sama jalan-jalan, mending langganan paket GrabUnlimited @grabid aja!!! Bisa nikmatin gratis ongkir Rp10rb tiap jajan di GrabFood dan diskon 15% tiap jalan pakai GrabBike & GrabCar. Plus diskon eksklusif buat nonton, main game hingga belanja! Langganannya GRATIS selama 8 minggu pertama. Modal gratis, untung berkali-kali!\n', 24009, '2023-09-09 02:59:14', 0.0246144, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3187739758021278683', 3683, 1, 310990),
(5363, '3187711530859352258', 'grabid', 14, 'https://www.instagram.com/p/Cw9Br-DSdDC/', 'Ngumpul guyub bareng temen emang paling asyik sambil ngopi‚òïÔ∏è\n\nKamu bisa pesan kopi TUKU #PercayaProjex di GrabFood sekaligus buat lanjutin aksi.\n\nDengan memesan menu-menu ini, kamu ikut berkontribusi memberikan donasi hingga Rp5rb/produk untuk lanjutin aksi sosial yang diinisiasi oleh komunitas sosial dari seluruh Indonesia, lhoüëá\n\n‚úÖ#TukuSeruDiRumah + Kantong Krimer Sedang\n‚úÖ#TukuSeruDiRumah\n‚úÖKopi Hitam Tetangga (Panas)\n‚úÖKopi Susu Tetangga (Panas)\n‚úÖCappuccino (Panas)\n‚úÖTetangga Blend \n‚úÖCipete Blend\n\nKapan lagi ngopi sekaligus bisa lanjutin aksi? Capcuss, ngeGrabFood sekarang!\n', 231, '2023-09-09 02:00:00', 0.000224883, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3187711530859352258', 22, 0, NULL),
(5364, '3187266940972356851', 'grabid', 14, 'https://www.instagram.com/p/Cw7cmVdANTz/', 'HEMATNYA DISKON KILAT 9.9 GAK BERCHANDYAAAü•∞\n\nYa pastinya dong GrabFoodie! Jajan sepuasnya menu kesukaan di #DiskonKilatGrabFood hematnya luar biasa! Nikmati diskon s.d 90% di jam 2 - 4 sore dan diskon s.d 50% + Gratis Ongkir s.d Rp600rb buat yang langganan GrabUnlimited.\n\nJangan sampai kelewat ya, promo Diskon Kilat 9.9 #GrabFoodID mulai 9 - 10 September aja. Buruan serbu karena terbatas di tiap jamnya! Let‚Äôs go #ngeGrabFood üíö\n', 6054, '2023-09-08 11:18:42', 0.00553318, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3187266940972356851', 171, 1, 234754),
(5365, '3184284478556386178', 'grabid', 14, 'https://www.instagram.com/p/Cww2dy4JLOC/', 'Untuk kamu yang terus #Percaya ada harapan setiap harinya\n\nUntuk kamu yang #Percaya bahwa satu langkah baik akan membawa perubahan\n\nUntuk kamu yang #Percaya bahwa tantangan ada untuk dihadapi dengan semangat\n\nSelamat Hari Pelanggan Nasional dari Grab dan OVO!\n\nYuk, kasih tahu di kolom komentar, layanan Grab mana yang paling sering kamu gunakan dan dapatkan Exclusive Box #Percaya dari Grab dan OVO untuk 5 orang yang beruntung.\n#GuyubPercaya\n', 16353, '2023-09-04 08:33:25', 0.0151916, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3184284478556386178', NULL, 0, NULL),
(5366, '3181894501543085796', 'grabid', 14, 'https://www.instagram.com/p/CwoXDDVPobk/', 'Banyak cara bisa kita lakukan untuk membangkitkan semangat keguyuban, seperti teman-teman Influencers dan Content Creator yang ikut bergotong royong melakukan kegiatan sosial dengan passion dan caranya masing-masing, mulai dari bikin perpustakaan keliling buat anak-anak, hingga memperbaiki mushola yang rusak. \n\nTerima kasih kak @arieltatum @billmohdor @fadlanholao @brendaehan @sanialeonardo dan teman-teman @teralafoundation telah dan akan  ikut bergotong-royong dengan berbagi kepada masyarakat dan komunitas. \n\nDalam guyub kita percaya!\n\n#GuyubPercaya #Percaya\n', 377, '2023-09-01 01:25:08', 0.000400878, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3181894501543085796', 74, 1, 5125),
(5367, '3181329947846981383', 'grabid', 14, 'https://www.instagram.com/p/CwmWrtuuzcH/', 'Sekarang gw baru sadar..\n\nTernyata lewat ngopi gw bisa ngasih impact ke sekeliling gw.\n\nGak sendiri, tapi lewat kolaborasi Grab X Toko Kopi Tuku.\n\nGak cuma buat menuhin kebutuhan, sekarang Lo bisa langsung berdonasi 2 ribu - 5 ribu rupiah abis order minuman favorit Lo di Tuku via GrabFood.\n\nBuat Lo yang mau ikutan donasi, periodenya mulai tanggal 18 Agustus - 22 September 2023.\n\nKarena bareng #PercayaProjex, Lo bisa makin guyub bareng tetangga.\n\n#GuyubPercaya #PercayaProjex #NgopiLanjutkanAksi\n', 441, '2023-08-31 06:44:29', 0.000413322, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3181329947846981383', 24, 1, 6766),
(5368, '3180705365868683907', 'grabid', 14, 'https://www.instagram.com/p/CwkIq2byCKD/', 'Cerita perjalanan @bruule__ yang inspiratif ini bisa banget jadi motivasi Juragan semua lho üòâüëåüèª\n\nDari pas target jualnya cuma 12 loyang sampai 12.000 transaksi per bulan sekarang, Bruule terus konsisten menerima kritik & masukan customer. Nggak cuman itu, Bruule juga memiliki tekad untuk terus berinovasi.\n\nGrabExpress Car sebagai andalan kirim-kirim pesanan ternyata bikin Bruule dapat banyak manfaat üòå Salah satunya adalah dapat Cashback OVO Points sampai 1 juta setiap bulannya ‚ú® Selain untuk bonus, cashback-nya juga bisa buat bantu beli bahan baku jualan lho. Cuan banget kan? üí∏\n\nKalo Bruule bisa, Juragan juga pasti bisa, yuk semangat! üí™üèª\n\n#SocialSeller\n#KlubJuragan\n#GrabExpress\n', 6959, '2023-08-30 10:02:51', 0.00621761, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3180705365868683907', 36, 1, 1358875),
(5369, '3180579788379422213', 'grabid', 14, 'https://www.instagram.com/p/CwjsHdSJH4F/', 'Throwback keseruan roadshow Pelatihan Keselamatan untuk Mitra yang diadakan di 5 kota (Medan, Jakarta, Bandung, Surabaya, Bali) dari akhir Juli lalu hingga Agustus ini.\n\nGa tanggung-tanggung, pelatihan ini menargetkan ratusan ribu Mitra Grab di seluruh Indonesia!\n\nDengan topik anti-kekerasan seksual dan keselamatan berkendara, Grab juga bekerja sama dengan @kemenpppa , @unfpaindonesia , @kemenhub151 dan @iddc.co.id untuk penyusunan dan penyampaian materi pelatihan kepada para Mitra.\n\nSemoga roadshow pelatihan ini bikin makin #PercayaAman pake Grab!\n', 348, '2023-08-30 05:53:41', 0.000332435, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3180579788379422213', 26, 1, 4079),
(5370, '3180482860180653403', 'grabid', 14, 'https://www.instagram.com/p/CwjWE93SUVb/', 'Siapa yang ikutan kerja bakti pas 17an kemaren? gotong royong bekerja emang bikin lelah, tapi kalo dikerjain bersama, #Percaya rasanya paripurna deh.\n\n#GuyubPercaya\n', 266, '2023-08-30 02:38:44', 0.00025866, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3180482860180653403', 25, 0, NULL),
