(5372, '3179285934573588895', 'grabid', 14, 'https://www.instagram.com/p/CwfF7aBp5Gf/', 'Kalo udah langganan emang jadi makin mudah. The Power of Langganan beneran bisa ngelakuin apa aja, Kirim Semaunya, Bayar Semurahnya. Makanya, buruan langganan Ongkir Unlimited GrabExpress. \n\nBiar bisa cobain juga, yuk ikutan GIVEAWAY berhadiah OVO Cash 300ribu dan dikirimin seblak sama Teh Rina Nose khusus untuk 10 orang yang beruntung di Jabodetabek!\n\nCaranya gampang banget, tinggal komen aja pake pantun tapi harus ada kata ‚Äúseblak‚Äù kayak yang dicontohin Nur. Mana pantun andalan kamu?\n', 46123, '2023-08-28 11:31:01', 0.04139, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3179285934573588895', 442, 1, 2439485),
(5373, '3179287159335532360', 'grabid', 14, 'https://www.instagram.com/p/CwfGNOrJ7dI/', 'Dulu pas kecil seneng ikutan lombanya, kalo sekarang seneng ngehias dan ikut dalam nyiapin lomba.\n\nEntah kenapa ngerjain kaya gini gak kerasa capeknya, dan sering kali takjub sendiri sama hasilnya \"lahh ternyata kita bisa ngerjain beginian yaa\" üòÇüòÇüòÇ\n\nOhiya, ayo ikutan aksi sosial bareng @grabid dan @ovo_id dengan ubah promo Grab jadi donasi dengan gunain kode promo GUYUBPERCAYA saat transaksi di Grab! 1 x transaksi kalian = donasi sebesar Rp3.000.\n\nDan kalo lu punya video perayaan 17an, bersihin lingkungan atau ngehias perkampungan bareng temen dan tetangga, langsung aja upload dan jangan lupa ditambahin lagu \"Goyang Royong\" dari Grab, kaena bisa dapet hadiah! Ada ipad, emas, dan berbagai hadiah menarik lainnya!\n\nTunjukin keberasamaan dan guyubnya dari daerah lu yaa!\n\n#guyubpercaya #percaya\n', 1230, '2023-08-28 11:05:03', 0.00114308, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3179287159335532360', 56, 1, 10715),
