(13145, '3255423033169154468', 'lazada_id', 12, 'https://www.instagram.com/p/C0tlgAtrBGk/', 'Buat Stellar yang di Jakarta dan Surabaya, are you ready for #LazadaFest1212 @lazada_id?!! üôå\n\nPastiin kamu selfie, foto, dan rekam keseruanmu sebanyak-banyaknya yaa. Karena @stella.freshener udah siapin hadiah senilai total Rp10 juta untuk pengalaman Konser Happy, STELLAlu Wangi paling seru darimu!\n\n10 Stellar yang memenuhi syarat dan beruntung bisa menangin Light Stick Red Velvet, Light Stick SHINee, Album SHINee, Tumbler Corkcicle, Fujifilm Instax, atau Bluetooth Speaker JBL, lho! \n\nCaranya:\n1. Post foto atau video pengalaman #StellaluWangi kamu selama ngonser nanti. Bebas mau upload di Feed, Reels, atau Story IG kamu. Kalau di IG Story, ingat untuk simpan di Highlight, yaa! \n2. Tulis ceritamu di bagian caption. Ada momen gak terlupakan? Aroma yang bikin nyaman dan hepi? Boleh banget di-spill di sini!\n3. Terakhir, tulis hadiah yang pengen kamu menangin dan kenapa kamu pengen banget hadiah itu? \n4. Pastikan kamu sudah like postingan ini, serta follow dan tag @stella.freshener. Sertakan juga hashtag #STELLAluWangi #KonserHappySTELLAluWangi. \n\nMakin banyak yang Stellar post dan ceritain, makin besar kesempatan menangmu*! \nGiveaway ini berlangsung s/d 31 Desember 2023 jam 23:59 dan hanya berlaku untuk Stellar yang ikutan Lazada Festival 12.12 di Jakarta dan Surabaya. So, don‚Äôt miss it dan good luck!\n\n*Syarat dan ketentuan berlaku. Keputusan juri dalam menentukan pemenang dan hadiah yang dimenangkan tidak dapat diganggu gugat.\n #StellaluWangi #KonserHappySTELLAluWangi\n', 424, '2023-12-11 12:24:01', 0.000137468, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\lazada_id\\posts\\3255423033169154468', 23, 1, 7415),
